import Typography from '@material-ui/core/Typography'
import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles({
    TypographyStyle:{
        // fontweight: 800
    }

})

export default function Thirdrow() {
  const classes = useStyles();
    return(<>
        <Typography id="Typographyid">
            Linked accounts
        </Typography>
             <Typography id="Typographyid2">
             We use this to let you sign in and populate your profile information
             </Typography>
             
             
             
        <Box display="flex" p={1} >
        <Box p={1} >
        <Avatar id="Avatarid" alt="Remy Sharp" src="/static/images/avatar/1.jpg" />
        </Box>
        <Box p={1} flexGrow={0.83} >
        <Typography id="Typographyid3">
             Sign in with Google
             </Typography>
        </Box>
        <Box p={1}>
        <Button id="btnid" variant="outlined" color="primary">
         Connect
        </Button>
        </Box>
      </Box>
        </>
    );
}
